import "./_opening.scss";

const Opening = () => {
    return (
        <>
            {/*<section className="intro_container container">*/}
            {/*    <h3 className="intro_text" >Blog motocyklowy to miejsce, w którym udostępniam porady dla motocyklistek i motocyklistów, zdjęcia i relacje z podróży (tych mniejszych i tych większych) oraz inne treści. Chciałabym, aby na blogu każdy znalazł coś dla siebie, bez względu na wiek, płeć czy ilość przejechanych kilometrów. Artykuły mają charakter przede wszystkim informacyjny oraz poradnikowy, ponieważ pragnę dzielić się z Wami wiedzą oraz doświadczeniem. Ważne, aby każdy kierowca wiedział, jak dbać o motocykl oraz bezpieczeństwo na drodze. Porady dla osób lubiących pogrzebać przy motorze pozwalają zaoszczędzić czas i pieniądze. Równie ciekawe mogą okazać się wspomnienia z trasy. Śledź naszą aktywność także na facebooku!</h3>*/}
            {/*</section>*/}
            <section className="opening">
                <div className="opening_container">
                    <h1 className="opening_header">Chorwacja 2022</h1>
                </div>
            </section>
        </>
    );
};

export default Opening;
